import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let postsData = [{ id: 1, message: 'Hi' , likequantity: 23},
    { id: 2, message: 'Hello' , likequantity: 23},
    { id: 3, message: 'you' , likequantity: 23},
    { id: 3, message: 'Yo' , likequantity: 23},
    { id: 5, message: 'Good bay' , likequantity: 23},
    { id: 6, message: 'Lose' , likequantity: 23}]

    let dialogs = [
        { id: 1, name: 'Alex' },
        { id: 2, name: 'Matvey' },
        { id: 3, name: 'Victor' },
        { id: 4, name: 'Sasha' },
        { id: 5, name: 'Artem' },
        { id: 6, name: 'Pasha' }
    ]

    let messeges = [
        { id: 1, message: 'Hi' },
        { id: 2, message: 'Hello' },
        { id: 3, message: 'you' },
        { id: 3, message: 'Yo' },
        { id: 5, message: 'Good bay' },
        { id: 6, message: 'Lose' }
    ]

ReactDOM.render(<App postsData={postsData} messeges={messeges} dialogs={dialogs}/>, document.getElementById('root'));

serviceWorker.unregister();
